import styled from "styled-components";

const MainStyled = styled.main`
  width: 100vw;
  height: 75vh;
  background-color: var(--grey-4);
  form {
    display: flex;
    flex-direction: column;
    width: 30rem;
  }
`;

export default MainStyled;
